import React ,{Component} from 'react';
class Precedence extends Component{
  constructor(){
    super();
    console.log("constructor comes first");
  }
  render(){

  console.log("render comes second");

  }
ComponentDidMount(){
    console.log("ComponentDidMount comes third");
}

  }
export default Precedence
